import { firestoreReadText } from "./FirebaseAPI.ts";
import TaskRow from './TaskRow';
const TaskList = () => {
    var rows = [];
    firestoreReadText((id, text, err) => {
        rows.push(<TaskRow displayText={text} id={id}/>);
    })
    console.log(`Number of rows rendered: ${rows.length}`)
    return (
        <div>
            {rows}
        </div>
    );
}

export default TaskList;
